pragma solidity ^0.7.0;
pragma abicoder v2;

import "./ISideNFTToken.sol";
import "../zeppelin/token/ERC721/ERC721.sol";
import "../zeppelin/token/ERC721/ERC721Burnable.sol";

contract SideNFTToken is ISideNFTToken, ERC721, ERC721Burnable {
  address public minter;
  string private _contractURI;

  constructor(string memory _name, string memory _symbol, address _minter, string memory _baseURI, string memory contractURI_) ERC721(_name, _symbol) {
    require(_minter != address(0), "SideToken: Empty Minter");
    minter = _minter;
    _setBaseURI(_baseURI);
    _setContractURI(contractURI_);
  }

  function _setContractURI(string memory contractURI_) internal {
    _contractURI = contractURI_;
  }

  function contractURI() public view returns (string memory) {
    return _contractURI;
  }

  modifier onlyMinter() {
    require(_msgSender() == minter, "SideToken: Caller is not the minter");
    _;
  }

  function mint(address account, uint256 tokenId) external onlyMinter override {
    _mint(account, tokenId);
  }
}","keccak256":"0x83256170d784726faef65af12824e6c60d296b1360e5b949bc65dd674233ee95","license":"MIT"},"contracts/nftbridge/SideNFTTokenFactory.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity ^0.7.0;
pragma abicoder v2;

import "../zeppelin/ownership/Secondary.sol";
import "./ISideNFTTokenFactory.sol";
import "./SideNFTToken.sol";

contract SideNFTTokenFactory is ISideNFTTokenFactory, Secondary {

    function createSideNFTToken(string calldata name, string calldata symbol, string calldata baseURI,
        string calldata contractURI) external onlyPrimary override returns(address) {
        address sideTokenAddress = address(new SideNFTToken(name, symbol, primary(), baseURI, contractURI));
        emit SideNFTTokenCreated(sideTokenAddress, symbol, baseURI, contractURI);
        return sideTokenAddress;
    }
}","keccak256":"0x69b402f7f4a3c074dcb2756e6def4f60a0c6d090e28d28d2ec5e158144fbf0ad","license":"MIT"},"contracts/zeppelin/GSN/Context.sol":{"content":"// SPDX-License-Identifier: MIT

